/*
*  Function :  GetTestData
*
*  Builds the table of input data which represents the matrix order and the
*  input matrix.  This is the "real world" data stream which
*  drives the algorithm.
*
*/    

n_int
GetTestData( n_void )
{        
    int i ; 

    inpVariable = (varsize*)
        th_malloc( ( NUM_TESTS + 1 ) * sizeof( varsize ) + sizeof (varsize)) ;
    inpVariableFree = inpVariable;
	inpVariable = ((varsize *)ROUNDUP(inpVariable, sizeof (varsize)));

    if( inpVariable == NULL )
    {
        return false ; 
    }

    /*  Copy the test values from ROM to RAM  */    
    for( i = 0 ; i < NUM_TESTS ; i++ )
    {
        inpVariable[i] = ( varsize )inpVariableROM[i] ; 
    }

    return true ; 

} /* End of function 'GetTestData' */

/*
*  Function :  GetInputValues
*
*  On each pass of the algorithm, the matrix order and the matrix itself are 
*  input. Each time this function is called, the next input value set is
*  pulled from the table in RAM. The table wraps around, so that input data is
*  continuous. A flag is returned TRUE whenever the table wraps around.
*
*/    

n_int
GetInputValues( n_void )
{        
    int row ;
    int col ; 
    varsize *mPtr ; 

    nCount = (int)inpVariable[tableCount++ ] ; 

    /* Allocate memory for the matrices */    

    resultB = (varsize*)
        th_malloc( ( nCount + 1 ) * sizeof( varsize ) ) ; 
    
    rowPtr = (varsize*)
        th_malloc( nCount * ( nCount + 1 ) * sizeof( varsize ) ) ; 
    
    matrixA = (varsize**)
        th_malloc( ( nCount + 1 ) * sizeof( varsize * ) ) ; 

    if( ( matrixA == NULL ) || 
        ( resultB == NULL ) || 
        ( rowPtr == NULL ) )
    {
        return -1 ; 
    }

    /* Fill the pointers to the rows */    
    mPtr = rowPtr ; 

    for( row = 0 ; row < nCount ; row++ )
    {
        matrixA[row] = mPtr ; 
        mPtr += nCount ; 
    }

    /* Fill the matrix( and result vector )with test data */    
    for( row = 0 ; row < nCount ; row++ )
    {        
        for( col = 0 ; col < nCount ; col++ )
        {
            matrixA[row][col] = inpVariable[tableCount++ ] ; 
        }
        resultB[row] = inpVariable[tableCount++ ] ; 
    }

    /* If you run out of test data, then start table over */    
    if( tableCount < NUM_TESTS )
    {
        return 0 ; 
    }

    tableCount = 0 ; 
    return( 1 ) ; 

} /* End of function 'GetInputValues' */


